css:
.npm-docs {
  font-family: "Helvetica Neue", Helvetica, sans-serif;
  font-size: 14px;
  line-height: 1.6;
  background-color: #fff;
  overflow: scroll;
  box-sizing: border-box;
  padding: 20px;
}
.npm-docs :not(.editor-colors) > code {
  color: #333;
}
.npm-docs pre,
.npm-docs code,
.npm-docs tt {
  font-size: 12px;
  font-family: "Inconsolata", Consolas, Courier, monospace;
}
.npm-docs a {
  color: #4183c4;
}
.npm-docs ol > li {
  list-style-type: decimal;
}
.npm-docs ul > li {
  list-style-type: disc;
}
.npm-docs > *:first-child {
  margin-top: 0 !important;
}
.npm-docs > *:last-child {
  margin-bottom: 0 !important;
}
.npm-docs a.absent {
  color: #c00;
}
.npm-docs a.anchor {
  display: block;
  padding-left: 30px;
  margin-left: -30px;
  cursor: pointer;
  position: absolute;
  top: 0;
  left: 0;
  bottom: 0;
}
.npm-docs h1,
.npm-docs h2,
.npm-docs h3,
.npm-docs h4,
.npm-docs h5,
.npm-docs h6 {
  font-family: "Helvetica Neue", Helvetica, sans-serif;
  margin: 20px 0 10px;
  padding: 0 0 10px 0;
  font-weight: bold;
  -webkit-font-smoothing: antialiased;
  cursor: text;
  position: relative;
}
.npm-docs h1 .octicon-link,
.npm-docs h2 .octicon-link,
.npm-docs h3 .octicon-link,
.npm-docs h4 .octicon-link,
.npm-docs h5 .octicon-link,
.npm-docs h6 .octicon-link {
  display: none;
  color: #000;
}
.npm-docs h1:hover a.anchor,
.npm-docs h2:hover a.anchor,
.npm-docs h3:hover a.anchor,
.npm-docs h4:hover a.anchor,
.npm-docs h5:hover a.anchor,
.npm-docs h6:hover a.anchor {
  text-decoration: none;
  line-height: 1;
  padding-left: 0;
  margin-left: -22px;
  top: 15%;
}
.npm-docs h1:hover a.anchor .octicon-link,
.npm-docs h2:hover a.anchor .octicon-link,
.npm-docs h3:hover a.anchor .octicon-link,
.npm-docs h4:hover a.anchor .octicon-link,
.npm-docs h5:hover a.anchor .octicon-link,
.npm-docs h6:hover a.anchor .octicon-link {
  display: inline-block;
}
.npm-docs h1 tt,
.npm-docs h2 tt,
.npm-docs h3 tt,
.npm-docs h4 tt,
.npm-docs h5 tt,
.npm-docs h6 tt,
.npm-docs h1 code,
.npm-docs h2 code,
.npm-docs h3 code,
.npm-docs h4 code,
.npm-docs h5 code,
.npm-docs h6 code {
  font-size: inherit;
}
.npm-docs h1 {
  font-size: 28px;
  color: #000;
}
.npm-docs h2 {
  font-size: 24px;
  border-bottom: 1px solid #ccc;
  color: #000;
}
.npm-docs h3 {
  font-size: 18px;
}
.npm-docs h4 {
  font-size: 16px;
}
.npm-docs h5 {
  font-size: 14px;
}
.npm-docs h6 {
  color: #777;
  font-size: 14px;
}
.npm-docs p,
.npm-docs blockquote,
.npm-docs ul,
.npm-docs ol,
.npm-docs dl,
.npm-docs table,
.npm-docs pre {
  margin: 15px 0;
}
.npm-docs hr {
  background: transparent;
  border: 0 none;
  color: #ccc;
  height: 4px;
  padding: 0;
}
.npm-docs > h2:first-child,
.npm-docs > h1:first-child,
.npm-docs > h1:first-child + h2,
.npm-docs > h3:first-child,
.npm-docs > h4:first-child,
.npm-docs > h5:first-child,
.npm-docs > h6:first-child {
  margin-top: 0;
  padding-top: 0;
}
.npm-docs a:first-child h1,
.npm-docs a:first-child h2,
.npm-docs a:first-child h3,
.npm-docs a:first-child h4,
.npm-docs a:first-child h5,
.npm-docs a:first-child h6 {
  margin-top: 0;
  padding-top: 0;
}
.npm-docs h1 + p,
.npm-docs h2 + p,
.npm-docs h3 + p,
.npm-docs h4 + p,
.npm-docs h5 + p,
.npm-docs h6 + p {
  margin-top: 0;
}
.npm-docs li p.first {
  display: inline-block;
}
.npm-docs ul,
.npm-docs ol {
  padding-left: 30px;
}
.npm-docs ul.no-list,
.npm-docs ol.no-list {
  list-style-type: none;
  padding: 0;
}
.npm-docs ul li > :first-child,
.npm-docs ol li > :first-child,
.npm-docs ul li ul:first-of-type,
.npm-docs ol li ul:first-of-type {
  margin-top: 0;
}
.npm-docs ul ul,
.npm-docs ul ol,
.npm-docs ol ol,
.npm-docs ol ul {
  margin-bottom: 0;
}
.npm-docs dl {
  padding: 0;
}
.npm-docs dl dt {
  font-size: 14px;
  font-weight: bold;
  font-style: italic;
  padding: 0;
  margin: 15px 0 5px;
}
.npm-docs dl dt:first-child {
  padding: 0;
}
.npm-docs dl dt > :first-child {
  margin-top: 0;
}
.npm-docs dl dt > :last-child {
  margin-bottom: 0;
}
.npm-docs dl dd {
  margin: 0 0 15px;
  padding: 0 15px;
}
.npm-docs dl dd > :first-child {
  margin-top: 0;
}
.npm-docs dl dd > :last-child {
  margin-bottom: 0;
}
.npm-docs blockquote {
  border-left: 4px solid #DDD;
  padding: 0 15px;
  color: #777;
}
.npm-docs blockquote > :first-child {
  margin-top: 0;
}
.npm-docs blockquote > :last-child {
  margin-bottom: 0;
}
.npm-docs blockquote p {
  font-size: 16px;
  line-height: 1.5;
}
.npm-docs table th {
  font-weight: bold;
}
.npm-docs table th,
.npm-docs table td {
  border: 1px solid #ccc;
  padding: 6px 13px;
}
.npm-docs table tr {
  border-top: 1px solid #ccc;
  background-color: #fff;
}
.npm-docs table tr:nth-child(2n) {
  background-color: #f8f8f8;
}
.npm-docs img {
  max-width: 100%;
}
.npm-docs span.frame {
  display: block;
  overflow: hidden;
}
.npm-docs span.frame > span {
  border: 1px solid #ddd;
  display: block;
  float: left;
  overflow: hidden;
  margin: 13px 0 0;
  padding: 7px;
  width: auto;
}
.npm-docs span.frame span img {
  display: block;
  float: left;
}
.npm-docs span.frame span span {
  clear: both;
  color: #333;
  display: block;
  padding: 5px 0 0;
}
.npm-docs span.align-center {
  display: block;
  overflow: hidden;
  clear: both;
}
.npm-docs span.align-center > span {
  display: block;
  overflow: hidden;
  margin: 13px auto 0;
  text-align: center;
}
.npm-docs span.align-center span img {
  margin: 0 auto;
  text-align: center;
}
.npm-docs span.align-right {
  display: block;
  overflow: hidden;
  clear: both;
}
.npm-docs span.align-right > span {
  display: block;
  overflow: hidden;
  margin: 13px 0 0;
  text-align: right;
}
.npm-docs span.align-right span img {
  margin: 0;
  text-align: right;
}
.npm-docs span.float-left {
  display: block;
  margin-right: 13px;
  overflow: hidden;
  float: left;
}
.npm-docs span.float-left span {
  margin: 13px 0 0;
}
.npm-docs span.float-right {
  display: block;
  margin-left: 13px;
  overflow: hidden;
  float: right;
}
.npm-docs span.float-right > span {
  display: block;
  overflow: hidden;
  margin: 13px auto 0;
  text-align: right;
}
.npm-docs code,
.npm-docs tt {
  margin: 0 2px;
  padding: 0 5px;
  border: 1px solid #eaeaea;
  background-color: #f8f8f8;
  border-radius: 3px;
  text-shadow: none;
}
.npm-docs code {
  white-space: nowrap;
}
.npm-docs pre > code {
  margin: 0;
  padding: 0;
  white-space: pre;
  border: none;
  background: transparent;
}
.npm-docs pre {
  background: #f8f8f8;
  border: 1px solid #ccc;
  font-size: 13px;
  line-height: 19px;
  overflow: auto;
  padding: 6px 10px;
  border-radius: 3px;
}
.npm-docs pre code,
.npm-docs pre tt {
  margin: 0;
  padding: 0;
  background-color: transparent;
  border: none;
}
.npm-docs .emoji {
  height: 20px;
  width: 20px;
}
